import React from 'react'
import Header from '../components/Header'
import NavBar from '../components/NavBar'
import Postagem from '../components/Postagem';

function Feed(){
    return(
        <div style={{ backgroundColor: '#F5F5F5' }}>
            <Header />
            <NavBar />
            <Postagem />
        </div> 
    );
}
export default Feed;
